const Pagination = () => {
  return (
    <div className='pagination'>
      <FaAngleLeft></FaAngleLeft>
      <input className='page-number' type='number' ></input>
      <div>of</div>
      <div>10</div>
      <FaAngleRight></FaAngleRight>
    </div>
  )
}

export default Pagination;
